import{_ as t,c as e,o as i,ah as n}from"./chunks/framework.CyOEM546.js";const d=JSON.parse('{"title":"⚙️ 其他類社團","description":"","frontmatter":{},"headers":[],"relativePath":"zh-yue/associations/others.md","filePath":"zh-yue/associations/others.md","lastUpdated":1756471203000}'),o={name:"zh-yue/associations/others.md"};function h(r,a,l,p,s,c){return i(),e("div",null,a[0]||(a[0]=[n('<h1 id="⚙️-其他類社團" tabindex="-1">⚙️ 其他類社團 <a class="header-anchor" href="#⚙️-其他類社團" aria-label="Permalink to &quot;⚙️ 其他類社團&quot;">​</a></h1><h2 id="職業發展協會" tabindex="-1">職業發展協會 <a class="header-anchor" href="#職業發展協會" aria-label="Permalink to &quot;職業發展協會&quot;">​</a></h2><p>職業發展協會（Career Development Association，簡稱CDA）創立於2007年，曾兩度獲五星社團，常年保持四星社團。職協秉持「服務廣大同學，增強就業能力」嘅宗旨，十幾年來舉辦各種職業類活動，為同學提供零距離體驗職場環境嘅平台。同時長期協助學生職業發展處舉辦國際研究生教育展等活動，掌握優秀校友資源。亦會主辦留學經驗分享會，為廣大UICer未來發展提供更好嘅渠道。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU8lT4U8LboRN8Ltl-boRn2ozlYUNnjknm94L7VVnl-DolU0gihFp2hmCIa0MkyPM1h2MYybMlUiLzT2olM7oz-sMz-8MRUioRGDL4UsLznFozUDMmlYL4VFLz-ZoRNJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="創行團隊" tabindex="-1">創行團隊 <a class="header-anchor" href="#創行團隊" aria-label="Permalink to &quot;創行團隊&quot;">​</a></h2><p>Enactus創行創立於2008年，係一個青年體驗式學習成長平台。我哋致力於發揚正直、熱情、創新、合作嘅優秀品質，傳承創行熱血青年的使命同願景。透過商業創新同實踐為青年人才鋪好創業發展路，為社會帶來積極影響。成立16年嚟，開展並運營超過20個特色項目，同時帶領團隊獲得數十項獎項，贏得無數榮譽。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM7CTYMl-iMRlDntmNYnNrfU4NPU4GjaMl7aol-ZnNr7Ul70gihFp2hmCIa0M1hfMkysLSyPnRCYn7VVM7r2MzfkU8lsM4CPLzUYn7rkUmMFU8MVoz6VnRfFLzW7U4UJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="尖峰創想社" tabindex="-1">尖峰創想社 <a class="header-anchor" href="#尖峰創想社" aria-label="Permalink to &quot;尖峰創想社&quot;">​</a></h2><p>理想同現實之間嘅距離到底有幾遠？</p><p>加入TEDxBNBU，搵到你心中滿意嘅答案。作為TED TALK喺2009年推出嘅獨立項目，TEDxBNBU旨喺鼓勵世界各地嘅TED粉絲自發組織TED相關活動。TEDxBNBU一直遵循TED嘅理想，致力於讓一切有價值嘅想法同創意唔再受「不可抗力」嘅限制。與一群優秀小伙伴透過演講、沙龍同展覽令思想流動，令創意落地！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NUN7T4UNQRL87sMtzrfU4NiM77YMlUjZoz98Lm9iolLDM4N0gihFp2hmCIa0n1y8UYy4UYybM4Wfn7n7Mmf7M7-iU8-8L7-8MR9Zn7WRn7QFol-aM8Q2nmWFLzG8UN7Jv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="創野社" tabindex="-1">創野社 <a class="header-anchor" href="#創野社" aria-label="Permalink to &quot;創野社&quot;">​</a></h2><p>創野社 (Wall Free Club），簡稱WFC，創立於2012年，曾係BNBU唯一嘅社企。依家正計劃喺校內重新啟動創野水吧項目，透過售賣咖啡嚟進行慈善活動。除此之外，我哋仲為學校師生帶來GOGOG0、咖啡文化節等傳統活動，從未停止喺創新創意道路上奔跑嘅步伐。</p><p>加入創野，成為夢想家，探索無限可能！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL8VT2LRLbM8W2ntmCbU4Uan7-PM7QjVoll8LmMVUzCYM8C0gihFp2hmCIa0MSyZUYhVn1yDLmvaoR-bMRUbMz9DL4rkMmW7U4n7LzWkLNQFMNWVo7UaL4VFLz7ZMRNJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="飲食文化社" tabindex="-1">飲食文化社 <a class="header-anchor" href="#飲食文化社" aria-label="Permalink to &quot;飲食文化社&quot;">​</a></h2><p>飲食文化社，係一個致力於品嚐美食、學習美食、製作美食嘅文化品鑑社團。本社團會舉辦奶茶節、蛋糕節、美食節等高自由度美食品鑑活動，喺呢度，你唔單止可以了解到每一道美食嘅文化，仲可以親手製作並分享畀其他同學。飲食文化社以品鑑同操作為先，喺體驗飲食風采嘅同時學習如何製作。除此之外，我哋仲會唔定期舉辦探店等活動，並喺飲食文化社公眾號發布，為同學推薦更多美食，豐富校園生活。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMmvTsUzLZUmWfLtzTVMzAfo7UPL7CjbLmWVUz-8nll4ozG0gihFp2hmCIa0n1yiM1hVoShVL4C8nmT7U8lYMNWRLR9PU4-ZozTfM7lPMNQFM4U4M4GanRnFLz-DnlCJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="播音主持協會" tabindex="-1">播音主持協會 <a class="header-anchor" href="#播音主持協會" aria-label="Permalink to &quot;播音主持協會&quot;">​</a></h2><p>播音主持協會係一個專注於播音同主持藝術嘅學生社團，為熱愛舞台同聲音嘅同學提供一個鍛鍊同展示自我嘅平台。協會下設三個部門：行政部、宣傳部、策劃部。協會共有兩個欄目，表演欄目包括舞台配音表演，成員可以喺舞台上展示自己嘅聲音演繹才能。主持欄目則為校園內外各類活動提供主持服務，幫助成員提升現場表現力同溝通技巧。</p><p>無論係對播音主持有興趣嘅初學者，定係希望提升舞台表現力嘅資深愛好者，播音主持協會都係你施展才華嘅理想舞台。歡迎加入我哋，成為聲音嘅使者，舞台嘅明星！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL49TDLmAkUzTfMtz-anzMVUm-4o77jboR-DLz6VozNYLzl0gihFp2hmCIa0n1h2USyYLkyinlW2U8LPnzGYMzVVn7nVLzARUm-aoR94M4nFMR9iLRCZLzrFn7rRoSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-bLkbw62w8c&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p>',22)]))}const M=t(o,[["render",h]]);export{d as __pageData,M as default};
